    2007/2008 Northwest Florida Water Management District - 5 Counties (Calhoun, Holmes,
    Washington, Jackson and Liberty), Florida lidar mapping project. The files were
    provided in a scheme of FDEM-derived 5,000 x 5,000 foot (1500 x 1500 meter) tiles.
